const columns = [
  { field: 'id', headerName: 'Name', width: 180, editable: true },
  { field: 'name', headerName: 'Age', type: 'number', editable: true },
  {
    field: 'email',
    headerName: 'Date Created',
    type: 'date',
    width: 180,
    editable: true,
  },
  {
    field: 'lastLogin',
    headerName: 'Last Login',
    type: 'dateTime',
    width: 220,
    editable: true,
  },
];
const ShowdataTable = () => {
    const [tabledate,setTabledata]= useState([])
    useEffect (() => {
 fetch('http://localhost:3001/users')
   .then((data) =>data.json())
 .then((data) => setTabledata(data))
}, [])
console.log(tabledate)

return(
<>
<h1>hello</h1>
<div style={{ height: 300, width: '80%', margin: "50px" }}>
      <DataGrid
        rows={tabledate}
        columns={columns}
        pageSize={3}
      />
    </div>
</>
)
}
export default ShowdataTable;
